	return (
		<div
			className="container me-2 d-flex justify-content-center text-center"
			style={{ height: 550 }}
		>
			<div className="spinner-border text-primary" role="status">
				<span className="visually-hidden">Loading...</span>
			</div>
		</div>
	);
};
